def sigmoid(z):
    np.seterr(over='ignore')
    g = 1.0 / (1.0 + np.exp(-z))
    return g

def predict(X,theta1,theta2):
    h1 = sigmoid(np.column_stack((np.mat([1]),X)) * np.transpose(theta1))
    h2 = sigmoid(np.column_stack((np.mat([1]),h1)) * np.transpose(theta2))
    return h2.tolist()